INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('20290023', 'Margherita', 'farine de blé, 31,6% tomates concassées, 13% fromage (lait) (6,5% Mozzarella, 6,5% Edam), eau, huile de colza, sel de cuisine, levure de boulanger, sucre, lait entier en poudre, levain de blé déshydraté (farine de blé, eau), basilic, origan, extrait de malt d\'orge, lactosérum doux en poudre (lait), oignon en poudre, ail en granulé, poivre noir, fafihes de matt torréfié (blé, orge), carottes en poudre. Peut contenir des traces de soja, d\'oeuf, de céleri, de moutarde et de graines de sésame. Elaboré en Allemagne. Préparation: Préchauffez le four. Prenez la pizza au congélateur et enlevez le film. Mettez la pizza surgelée sur la grille au centre de four et chauffez uniformément. Four électrique (convection naturelle): 220-230 oc, four à chaleur tournante: ca. 200 oc, Four à gaz: niveau 4-5. Faites cuire aéré (10-12 min.) ou brun croustillant (12-15 min.) à volanté. La pizza est prête quand le fromage est doré et la couleur du fond a la couleur désirée. Le temps de cuisson peut varier selon le fours Recommandation: vous onbtenez la meilleurcuisson avec convection naturelle.', 'https://static.openfoodfacts.org/images/products/20290023/front_fr.4.400.jpg', '5', '2.4', '31.5', '4.2', '0', '8.9', '0.95', '0.374015748031496', '', '1');

