VALUES ('20290443', 'Vitte - wheat and rice flakes', 'RO Fulgi de grâu integral şi orez în glazură cu zahăr, îmbogățtiti cu 8 vitamine și fier, cu fulgi de cereale în glazură cu iaurt si bucatele de vişine liofilizate. Ingrediente: 75% fulgi de grâu integral şi fulgi de orez în glazură cu zahăr, îmbogatiti cu 8 vitamine şi fier (42% gau integral, 22% orez, 7% zahăr, extract din malt de orz, sirop de glucoză, sare, fibre de ovăz, oligofructoză, emulsifiant: mono-şi digliceride ale acizilor graşi; vita mine: niacină, vitamina E, acid pantotenic, vitamina B6, riboflavină, tiamină, acid folic, vitamina B12; fier), 22% fulg de cereale in glazură cu iaurt [zahr, 4,2% făină de orez, grăsimi vegetale în proporții variate (sâmburi de palmier, palmier, floarea-soarelui, Shea, rapită), zer praf (din lapte), 1,5% făină de grâu integral, 0,4% iaurt praf, gluten din grâu, arome, germeni de grâu, sare, lapte praf degresat, extract din malt de orz, emulsifianti: lecitine din soia, mono - și digliceride ale acizilor graşi], 3% bucătele de vişine liofilizate. Poate contine urme de arahide, alte fructe cu coajă lemnoasă și semințe de susan. Se pot servi cu lapte, iaurt sau chefir. Produs in U.E. pentru S.C. Lidl Discount SRL, Sat Nedelea, Comuna Ariceștii Rahtivani, DN 72, Crângul lui Bot, Km 73+810, județul Prahova, România.', 'https://static.openfoodfacts.org/images/products/20290443/front_ro.4.400.jpg', '5.8', '4.5', '75', '22', '6.4', '8.4', '0.87', '0.34251968503937', '', '1');

