VALUES ('20290993', 'Tarte aux noix de Saint-Jacques & petits légumes', '_Garniture (62 %)_ : eau, 10 % noix de Saint Jacques* (_mollusques_), 7 % carottes, 7 % _œufs_, 5,5 % poivrons jaunes, fromage blanc (_lait_), 3,8 % crème fraîche (_lait_), amidon modiﬁé de maïs et/ou de riz, 1,8 % Emmental (_lait_), 1,5 % poireaux, fond de _poisson_ (fumet de _poisson_ (cabillaud (_poissons_), extrait de saumon (_poissons_), eau, sel), maltodextrine de blé, extrait de moule (_mollusques_), sel, fond de poulet (os, viandes et graisses de poulet, eau, sel), échalotes, dextrose, légumes en poudre, vin blanc réduit, vinaigre d‘alcool réduit, arômes, concentrés de légumes (contient _céleri_), extraits de levure, sirop de glucose, _lactose_, protéines de _lait_), ail, huile de tournesol, concentré de tomates, sel, persil, vermouth, curcuma. _Pâte feuilletée (38 %)_ : farines (farine de _blé_, farine de lèves, farine de _blé_ malté, antioxydant : acide ascorbique), eau, margarine (huiles et matières grasses végétales (palme, colza), eau, sel, émulsiﬁant : mono - et diglycérides d\'acides gras ; acidiﬁant : acide citrique ; colorant : caroténoïdes), sel. Traces éventuelles de _moutarde_, de _soja_ et de _fruits à coque_.', 'https://static.openfoodfacts.org/images/products/20290993/front_fr.17.400.jpg', '13', '6.4', '21', '2.3', '', '8.2', '0.9', '0.354330708661417', '', '1');

