VALUES ('2030503839683', 'Doonys assortis', 'Pâte : farine de blé, matières grasses (graisse végétale, huile végétale), eau, dextrose, sucre, sel, farine de soja, amidon, levure, poudre à lever E450i - E500ii, agent de traitement de la farine E300, poudre de lait écrémé, lactosérum en poudre. Arome vanille : pate de cacao, sirop de glucose, poudre de cacao dégraissée, émulsifiant : E471 - E481 - E322 - E472a - E473, stabilisant : E420 - E516, épaississant : E406 - E414 - E410, colorant : E171 - E160, arôme, agent d\'enrobage : E414 - E904. Chocolat : sucre, émulsifiant : E472e - E481 - E471, colorant E160. Décor sucre, pâte de cacao, beurre de cacao, poudre de lait, matière grasse laitière anhydre, émulsifiant E322 - E476, arôme. Arôme banane : émulsifiant E471 - E481 - E472e, lactosérum en poudre, colorant E160. Décor sucre, eau, pate de cacao, sirop de glucose, poudre de cacao dégraissé, stabilisant E420 - E516, huile végétale, épaississant E406 - E414 - E410, émulsifiant E322 - E473, agent d\'enrobage E414 - E904, extrait de carotte, arôme. Rose : sirop de glucose, émulsifiant E471 - E481 - E472e - E322 - E473, stabilisant E420 - E516, épaississant E406 - E414 - E410, colorant E120 - E100 - E171 - E160, arôme, agent d\'enrobage E414 - E904. Glace vermicelle sirop de glucose, émulsifiant E471 - E472e - E481 - E322 - E473, stabilisant E420 - E516, épaississant E406 - E414 - E410, colorant E171 - E162 - E161b - E160c - E160 - arôme, agent d\'enrobage E904 - E414, spiruline.', 'https://static.openfoodfacts.org/images/products/203/050/383/9683/front_fr.3.400.jpg', '19', '8.7', '51', '26', '', '5', '0.89', '0.350393700787402', '', '0');

